import React from 'react';
import { Link } from 'react-router-dom';
import './Home.css'; // Make sure this import exists

const Home: React.FC = () => {
  return (
    <div className="home-container">
      <h1>Welcome to the Digital Vehicle Inspection Application</h1>
      <p>This application allows vehicle owners to manage their vehicle inspections 
      and inspectors to verify vehicle authenticity.</p>

      <div className="auth-prompt">
        Please <Link to="/login" className="auth-link">log in</Link> or {' '}
        <Link to="/register" className="auth-link">register</Link> to get started.
      </div>
    </div>
  );
};

export default Home;
